Common.LongDescription.Common.Text:
Sought after industrial land of 5,730sqm (approx)
*  Level vacant block in a strategic position in burgeoning Hume
*  Brilliant opportunity for astute investor or owner-occupier
*  Various build options available, will suit many users, see below

To use the premises only for the purpose of one or more of the following:
(i) bulk landscape supplies;
(ii) freight transport facility;
(iii) general industry;
(iv) industrial trades;
(v) light industry;
(vi) plant and equipment hire establishment;
(vii) recycling facility;
(viii) store; and
(ix) warehouse

GROSS FLOOR AREA:  'That the combined gross floor area of all buildings erected on the land shall not exceed 5,730 square metres.'
